import React, { useEffect, useState } from 'react'
import Axios from 'axios';

function VerifyEvents() {
    const [toVerifylist,setToverifylist] = useState([]);
    useEffect(() => {
        Axios.get('http://localhost:3001/getNoneVerifiedEvents')
        .then((res)=>{
            if (res.data === "Error"){
                alert("")
            }
        })
        .catch((err)=>{
            alert(err);
        })
    }, [setToverifylist]);
    return (
        <div>
            <h2>Verify Events</h2>
            {console.log(toVerifylist)}
        </div>
    )
}

export default VerifyEvents
